import React, { useState, useEffect } from 'react'
import axios from "axios";
import logo from './logo.svg';
import './App.css';
import VideoPlayer from './VideoPlayer'

function App() {

  const [videoNames, setVideoNames] = useState(null);

  function showVideo({vidName}){
    <VideoPlayer videoUrl={vidName} />
  }

  useEffect(() => {
    axios({
      method: "GET",
      url: "/getall",
    })
    .then((response) => {
      const res = response.data;
      setVideoNames({
        videos: res.videos
      });

    })
    .catch((error) => {
      if (error.response) {
        console.log(error.response);
        console.log(error.response.status);
        console.log(error.response.headers);
      }
    });
  }, []);


  return (




    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
          startApp()
          {videoNames && videoNames.videos.map((videoName, index) => (
            <button key={index}>
              {videoName}
            </button>
          ))}


        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        {/* new line start*/}
        <p>To get your profile details: </p><button>Click me</button>
        {videoNames && <div>
              <p>Profile name: {videoNames.videos}</p>
              <VideoPlayer videoUrl={'14-08-2023-00-16-46.mp4'} />
            </div>
        }
         {/* end of new line */}
      </header>
    </div>
  );
}




export default App;
